import React from "react";
import Myauto from "./myauto";
import Header from "./header";
import Navbar from "./navbar";
import Main from "./main";
import data4 from "./data4.json";
import "./App.css";

function App() {
  let IDs: number[] = [16, 25, 16, 39, 24, 23, 3, 41];
  let page: number = 1;
  const items: object[] = data4.data.items;

  return (
    <>
      <Header />
      <Myauto />
      <Navbar />
      <Main IDs={IDs} page={page} />
    </>
  );
}

export default App;
